"use strict";

$(function () {
  $("input#meeting-item-search").on("keyup", function () {
    var e = $(this).val().toLowerCase();
    $(".screenshare-meeting-item").filter(function () {
      $(this).toggle(-1 < $(this).text().toLowerCase().indexOf(e));
    });
  });
}), $(window).on("load", function () {
  1599.98 < $(window).width() ? $("body").addClass("cb-asidecanvas-open") : $("body").removeClass("cb-asidecanvas-open");
});